import React from 'react';
import { Link } from 'react-router-dom'
import Aux from '../../hoc/Aux'
import './Navbar.scss'
import Logo from '../../images/logo.png'

class Navbar extends React.Component {
    render() {
    if (window.innerWidth >= 900) {
        console.log('Hello')
        return(
            <Aux>
                <div className = "main-nav">
                    <div className = "logo">
                        <Link to = "/"><img src = {Logo} alt = "ScaleHaus"/></Link>
                    </div>
                    <div className = "main-links">
                        <Link to= "/pricing">Pricing</Link>
                        <Link to= "#">Product</Link>
                        <Link to= "#">Contact</Link>
                        <Link to= "/login">Login</Link>
                    </div>
                </div>
            </Aux>
        )
    } else {
        console.log('mobile')
        return(
            <Aux>
                <div className = "container">
                    <div className="mobile-nav" onClick = {this.props.openNav}>
                        <div className="bar1"></div>
                        <div className="bar2"></div>
                        <div className="bar3"></div>
                    </div>
                    <div id="mySidenav" className="sidenav">
                        <Link to="/" onClick={this.props.openNav}>Overview <i className="fa fa-home" aria-hidden="true"></i></Link>
                        <Link to="/pricing" onClick={this.props.openNav}>Pricing <i className="fas fa-dollar-sign"></i></Link>
                        <Link to="#" onClick={this.props.openNav}>Contact <i className="far fa-envelope"></i></Link>
                        <Link to="/login" onClick={this.props.openNav}>Login <i className="fas fa-sign-in-alt"></i></Link>
                    </div>
                </div>
            </Aux>
        )}
    }
}

export default Navbar;
